import React, { Component } from "react";
import './Producto.css';

class Producto extends Component {


  render() {
    return (

      <div>
        <h1 class="titulo"> Trabajo Práctico Optativo N°1 </h1>
        <h2>Detalle de producto</h2>

        <div>Nombre: {this.props.productoNombre}</div>
        <div>Descripción: {this.props.productoDescripcion}</div>
        <div>Precio: {this.props.productoPrecio}</div>
        <div>SKU: {this.props.productoSKU}</div>
        <div>Cantidad: {this.props.productoCantidad}</div>



        <button class="boton">Comprar</button>


      </div>

    )
  }
}

export default Producto;
